        "title": "Entity Resolution",
        "excerpt":"What is Entity Resolution? Entity Resolution is the task of disambiguating manifestations of real world entities in various records or mentions by linking and grouping.1 Effectively reducing something to its most basic conical form. Linking entities to form relationships and draw conclusions from data is becoming increasingly relevant as making use of big data becomes prevalent in organizations and protecting data integrity expectations increases especially as it relates to making use of private personal data. Many organizations ranging from government and public health data, web search, comparison shopping, law enforcement are being expected to provide a higher level of transparency and protection of the data being collected and used for predicting behavior and accomplishing their goals.  Below are two short youtube videos(combined &lt; 5 minutes) when watched together give a good base for understanding the importance of the subject.Go deeper… 2008 Tip of iceberg versus today’s reality…    2008   2018 References             website:www.datacommunitydc.org &#8617;       ","categories": ["Exploring Big Data"],
